import React, { Component } from 'react';
import MainLayout from '../../components/layouts/mainLayout';

class Profile extends Component {
    render() {
        return (
            <>
                <MainLayout>
                    <h1>Welcome to the profile page</h1>
                </MainLayout>
            </>
        )
    }
}

export default Profile;
